rsonal reasons, I love to find the most unusual spots, excellent resorts, places that spare no detail, outstanding restaurants, great spas, and wonderful pools. Some of my favorites include the Ace in Palm Springs, the Adlon in Berlin, the Cosmopolitan in Las Vegas and just about anywhere on Hilton Head Island, SC. Other locations I like include the Outer Banks of NC, many cities in the US, any Leading Hotel of the World, much of the UK, and anywhere I haven&#38;#39;t been yet. :-). Mi estilo de viaje: Sólo lo mejor. Cuando viajo: intento mezclarme con los lugareños. Normalmente viajo por: Trabajo y diversión. Playa/Sol. Comida excelente/Vino. De compras. Spa. Conciertos / Festivales de música. Viajo con: Yo mismo. Cónyuge/alguien importante para mí. Familia numerosa. Amigos. Compañeros de trabajo. Mascotas. '),('DelPino','Mujer','35-49','Jaen','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Trabajo y diversión. '),('Delta6','NONE','NONE','Principado de Asturias','NONE'),('deltadevenus','Mujer','25-34','Barcelona, Cataluña','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Trabajo y diversión. Playa/Sol. Viajo con: Amigos. '),('DelvalleMadrid','NONE','NONE','NONE','NONE'),('demarc0','Hombre','NONE','guadalajara mexico','NONE'),('DEMOLMAN','NONE','NONE','VERANEANTE','NONE'),('denenDenenmadrid','Hombre','35-49','denenmadrid','Mi estilo de viaje: Sólo lo mejor. Normalmente viajo por: Diversión. '),('denhand','NONE','NONE','thurnscoe rotherham','NONE'),('denverflora','Mujer','35-49','Denver, CO','Acerca de mí: I like traveling independently instead of being part of organized tours.A few years back, I might have chosen &#34;roughing it&#34; to describe my travel style. Now, I&#39;ve definitely moved into the middle of the road category. I admit it, I&#39;ve gotten older and I prefer a bed to the tent now! I am drawn to the smaller, quieter, more off the beaten path locales.Given the choice, I avoid chain hotels wh