-one of them on a sailboat. We spend any extra money we have on traveling. I also have two girlfriends who enjoy traveling and we take a &#34;chick&#34; trip once a year. So, you can see that traveling is truly my life passion.. Mi estilo de viaje: A la aventura. Cuando viajo: intento mezclarme con los lugareños. Normalmente viajo por: Diversión. Playa/Sol. Museos/Cultura/Emplazamientos históricos. Naturaleza/Aventura. Comida excelente/Vino. De compras. Spa. Viajo con: Yo mismo. Cónyuge/alguien importante para mí. Amigos. '),('makotrix','Hombre','35-49','Palencia','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Diversión. '),('Malaga1','NONE','NONE','Málaga','NONE'),('malaga12','NONE','NONE','Málaga','NONE'),('MalagaPatty','NONE','NONE','malaga','NONE'),('malaguita89','NONE','NONE','malaga','NONE'),('Malditomushi','Hombre','NONE','Bahia Blanca, Argentina','NONE'),('maldivesaregreat','NONE','NONE','Glasgow, United Kingdom','NONE'),('Malex02','NONE','NONE','Mallorca','NONE'),('mali2007','Mujer','50-64','San Francisco, California','Mi estilo de viaje: A la aventura. Normalmente viajo por: Diversión. Playa/Sol. Museos/Cultura/Emplazamientos históricos. Comida excelente/Vino. De compras. Spa. Esquí/Deportes de invierno. Conciertos / Festivales de música. Viajo con: Familia con adolescentes. Familia numerosa. Amigos. '),('Mallkavian','NONE','NONE','Andalucia','NONE'),('MallorcaAntonia','Mujer','25-34','Mallorca','Normalmente viajo por: Diversión. '),('mallorcaval','Hombre','35-49','Balears','Mi estilo de viaje: Con un presupuesto ajustado. Normalmente viajo por: Diversión. '),('MallorcaViatjer','Hombre','35-49','Mallorca','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Trabajo y diversión. '),('Mallorquina78','Mujer','25-34','Barcelona, España','Mi estilo de viaje: Con un presupuesto ajustado. Normalmente viajo por: Diversión. '),('Malospelos','Hombre','35-49','Madrid','Mi estilo de viaje: Con un presupuesto ajus