 a mission to see the sights, watch the locals, soak up the atmosphere, take some great photos and enjoy the food. I get bored on the beach and prefer to spend no more than 2 nights in an average city (of course the great cities of the world need 3 - 5 nights). Then on to the next locale.As an example, here is part of my itinerary to South America in 2008:Wed Dec 3 - Wake up in the Amazon Rain Forest, take a river boat to Puerto Maldonado and fly to Cuzco, Peru.Thu - 4 hour train from Cuzco to Macchu Pichu, spend 4 hours at the ruins then 4 hour train back to Cuzco.Fri - Fly to Juliaca and see Lake Titicaca. Spend the night in Puno, Peru.Sat - Fly to Santiago, Chile connecting through Lima.Sun - Fly to the southern tip of Chile to Punta Arenas.Mon - 2 hour flight to Antarctica. Short tour of King George Island. Fly to Santiago.Tue - Fly to Easter Island.. Mi estilo de viaje: Dándose un lujo de vez en cuando. Cuando viajo: intento mezclarme con los lugareños. Normalmente viajo por: Diversión. Museos/Cultura/Emplazamientos históricos. Naturaleza/Aventura. Comida excelente/Vino. Viajo con: Yo mismo. Cónyuge/alguien importante para mí. Familia numerosa. Amigos. '),('Odrion','Hombre','25-34','San Cristobal','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Trabajo y diversión. '),('ohgreatbill','Hombre','NONE','Barcelona','NONE'),('oidrey','NONE','NONE','oidrey','NONE'),('okyalos','Hombre','35-49','Cyprus','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Trabajo. '),('OLBAP','NONE','NONE','MADRID','NONE'),('oldworldtraveller','Hombre','NONE','UK','NONE'),('oleMadrid','Mujer','NONE','madrid','NONE'),('OlgaLucia','NONE','NONE','Bogota','NONE'),('Olgaos','NONE','NONE','Ibague, Colombia','NONE'),('olgarela','NONE','NONE','BILBAO','NONE'),('OLI18','Mujer','NONE','NAVARRA','Mi estilo de viaje: Sólo lo mejor. Normalmente viajo por: Diversión. '),('Olibubble','Mujer','25-34','Bilbao','Mi estilo de viaje: Con un presupuesto