 to dine in locally owned restaurants, and on trips of a week or more, we spend an average of $90 per day in restaurants (up from $80 per day in 2008). We tend to spend more in restaurants on short trips.. Mi estilo de viaje: Dándose un lujo de vez en cuando. Cuando viajo: intento mezclarme con los lugareños. Normalmente viajo por: Diversión. Museos/Cultura/Emplazamientos históricos. Viajo con: Cónyuge/alguien importante para mí. '),('Wondervix','NONE','NONE','Bedfordshire','NONE'),('WorcesterMoray','Hombre','50-64','Worcester','Mi estilo de viaje: A la aventura. Normalmente viajo por: Diversión. '),('WorkingMom_811','Mujer','35-49','Southern California','Mi estilo de viaje: Dándose un lujo de vez en cuando. Normalmente viajo por: Trabajo y diversión. '),('world1','Hombre','35-49','La Rioja','Acerca de mí: Soy una persona previsora y exigente, amable, critico cuando es necesario y sé cuando alguien se esfuerza por agradar.. Mi estilo de viaje: Dándose un lujo de vez en cuando. Cuando viajo: Quiero toda la comodidad de mi hogar. Normalmente viajo por: Trabajo y diversión. Playa/Sol. Museos/Cultura/Emplazamientos históricos. Juegos de azar/Casinos. Naturaleza/Aventura. Comida excelente/Vino. Spa. Viajo con: Yo mismo. Cónyuge/alguien importante para mí. Familia con adolescentes. '),('worldambler','NONE','NONE','New York, NY','NONE'),('worldcitizenMadrid','Hombre','50-64','Madrid','Acerca de mí: Adoro la multiculturalidad y las tradiciones. Mezclarme con la gente y adaptarme a su forma de vida.Soy un gran amante de la naturaleza, la fotografia, la arqueologia y todo aquello que me transporte a las raices de un pueblo.. Mi estilo de viaje: Con un presupuesto ajustado. Cuando viajo: intento mezclarme con los lugareños. Normalmente viajo por: Trabajo y diversión. Playa/Sol. Museos/Cultura/Emplazamientos históricos. Parques temáticos / de atracciones. Naturaleza/Aventura. Comida excelente/Vino. De compras. Esquí/Deportes de invierno. Viajo con: Cónyuge/alguien importante pa